    const [isLogined, setIsLogined] = useState(false);

    const handleLogin = () => {
        setIsLogined(true);
      };

    return (
        <div class='element'>
                <div className="element">
      {isLogined ? <Enter></Enter> : <LoginBox2 onLogin={handleLogin}></LoginBox2>}
    </div>
        </div>
    );
}

export default Body;
